    1. Setiap postingan wajib menggunakan tagar #AFN
    2. Setiap postingan wajib menyertakan gambar

    9. Postingan yang memiliki kesamaan bisa ditolak
    10. Hubungi admin jika ada pertanyaan atau keluhan
